import pandas as pd
import requests

url = "https://www.banpt.or.id/direktori/model/dir_prodi/get_hasil_pencariannew.php?_=1706534897844"
try:
    response = requests.get(url)
    if response.status_code == 200:
        data = response.json()
        data = data['data']
        output = []

        for item in data:
            if 'padjadjaran' in item[0].lower():
                output.append(item)

        df = pd.DataFrame(output, columns=["pt", "prodi", "jenjang", "wilayah", "sk", "tahun_sk", "peringkat", "tgl_kadaluwarsa", "status_kadaluwarsa"])

        print(df.to_json())
    else:
        print(f"Error: {response.status_code}")
except Exception as e:
    print(f"An error occurred: {e}")
